(13, 'Winter', 'no-reply@captainshad.com', 'I noticed that your website uses the PHP Laravel framework. I\'d love to connect you with my Laravel developer in case you are looking for a programmer here in the USA to help with it. Can you call me at (210) 405-1423 and I can get you connect to him? My name is Winter. I\'m in the office 9-5 M-F CST.', 1, '2022-07-27 12:25:51', '2023-10-17 13:57:17'),
(14, 'Anthonypon', 'no.reply.feedbackform@gmail.com', 'Hi!  xoss.games \r\n \r\nDid yоu knоw thаt it is pоssiblе tо sеnd businеss оffеr uttеrly lеgit? \r\nWе prоffеr а nеw lеgаl mеthоd оf sеnding mеssаgе thrоugh fееdbасk fоrms. Suсh fоrms аrе lосаtеd оn mаny sitеs. \r\nWhеn suсh lеttеrs аrе sеnt, nо pеrsоnаl dаtа is usеd, аnd mеssаgеs аrе sеnt tо fоrms spесifiсаlly dеsignеd tо rесеivе mеssаgеs аnd аppеаls. \r\nаlsо, mеssаgеs sеnt thrоugh соmmuniсаtiоn Fоrms dо nоt gеt intо spаm bесаusе suсh mеssаgеs аrе соnsidеrеd impоrtаnt. \r\nWе оffеr yоu tо tеst оur sеrviсе fоr frее. Wе will sеnd up tо 50,000 mеssаgеs fоr yоu. \r\nThе соst оf sеnding оnе milliоn mеssаgеs is 49 USD. \r\n \r\nThis оffеr is сrеаtеd аutоmаtiсаlly. Plеаsе usе thе соntасt dеtаils bеlоw tо соntасt us. \r\n \r\nContact us. \r\nTelegram - @FeedbackMessages \r\nSkype  live:contactform_18 \r\nWhatsApp - +375259112693 \r\nWe only use chat.', 1, '2022-11-08 06:44:02', '2023-10-25 07:28:21'),
(15, 'SHOWA SP', 'downhamvankleeckeqro@yahoo.co.jp', 'お世話になっております。 \r\n \r\n湘南サービスの橋口(はしぐち)と申します。 \r\n \r\nBtpBビジネスをされてあって \r\n効果の高い営業ツールをお探しでしたら \r\nお役に立てます。 \r\n \r\n内容は \r\n企業のお問い合わせフォームにDMを送る \r\n営業代行です。 \r\nその数なんと600万社。 \r\n日本にある会社の約7割の数です。 \r\n \r\n「新規が2日で80件も来た」 \r\nという成功事例もあります。 \r\n \r\nなぜ効果が高いかというと \r\nお問い合わせフォームは \r\n開封率がほぼ100%だからです。 \r\n \r\n元々は \r\n自社の営業ツールとして開発したのですが \r\nあまりの効果に嬉しくなり \r\nリリースしよう！と至った次第です。 \r\n \r\n今なら破格でご案内しております。 \r\n詳細はこちら↓ \r\nhttps://kadoya-tokyo.site/ \r\n \r\n \r\nまずはお気軽にお問い合わせください。 \r\n \r\n最後までご覧いただき \r\n誠に有り難うございました。', 1, '2022-11-20 19:30:22', '2023-10-15 19:06:26'),
(16, 'tokyo AP', 'allplusbusiness+0001@gmail.com', '突然のご連絡失礼致します株式会社アルプラスの事務局です。 \r\n \r\n店舗運営されている方にとっては年末や年明けにと、売り上げを伸ばしたい時期でもありますよね！ \r\n \r\nこの時期に売上を最大化させることには非常に重要な意味があります。 \r\n \r\n競合店に打ち勝つための施策提案をするBuzz Plusは \r\n今回、集客でお悩みのオーナー様に今人気の集客戦略をご紹介します。 \r\n \r\n \r\n【１番人気！！Googleレビューサービス】 \r\n消費者は買う前に『調べる』時代に！ \r\nGoogleレビューサービスの点数を上げたい方はこちら \r\nhttps://allplustokyo.com/kuchikomi \r\n \r\n \r\n【２番人気：ターゲット広告】 \r\n店舗周辺に「今いる人」「住んでいる人」「過去に訪問した人」の \r\nスマートフォンへ広告配信をし御社のアピールをします。 \r\nhttps://allplustokyo.com/mapmarketing \r\n \r\n【Ｎｏ．3： ヨコドリ広告】 \r\n競合企業のWEBサイトに訪問者されたユーザーを \r\n自社サイトのページに誘導します。 \r\nhttps://allplustokyo.com/Competitive-Intelligence \r\n \r\n \r\n15分から20分ほど説明のお時間いただけないでしょうか？ \r\n------ \r\n以下希望日時を添付させていただきます。 \r\n \r\n【希望日時】 \r\n \r\n・11月21日（水）　9時～18時 \r\n \r\n・11月22日（木）　9時～14時 \r\n \r\n・11月24日（金）　9時～18時 \r\n \r\nお急ぎの場合や資料についてのご質問等は、お気軽にご連絡ください。 \r\nhttps://allplus.tokyo/contact/ \r\n \r\n \r\nーーーーーーーーーーーーーーーーーーーーーーーー \r\n株式会社アルプラス \r\nhttps://allplus.tokyo/ \r\n〒104-0061 東京都中央区銀座1-16-7 大栄ビル５F \r\n【受注可能な補助金・助成金をご提案します！】 \r\nhttps://allplustokyo.com/hojyokin-plus \r\n \r\nーーーーーーーーーーーーーーーーーーーーーーーー', 1, '2022-11-21 00:45:31', '2023-10-15 17:53:03'),
(17, 'Mike Kendal', 'no-replyhotahifs@gmail.com', 'Hi there \r\n \r\nI Just checked your xoss.games ranks and saw that your site is trending down for some time. \r\n \r\nIf you are looking for a trend reversal, we have the right solution for you \r\n \r\nWe are offering affordable Content Marketing plans with humanly written SEO content \r\n \r\nFor more information, please check our offers \r\nhttps://www.digital-x-press.com/product/content-marketing/ \r\n \r\nThanks and regards \r\nMike Kendal', 1, '2022-11-21 22:40:57', '2023-10-15 17:11:00'),
(18, 'keiyo chiken', 'mmm.inagaki@ymail.ne.jp', '突然のご連絡失礼致します。 \r\n \r\n月の複合機の経費を50%以上削減できたら良いと思いませんか？ \r\n \r\n「複合機の料金＝リース料　+　印刷代　このうち印刷代の利益を０にすることで約50％減が実現できます。」 \r\n \r\n白黒、カラー印刷共に一般的な印刷代金の1/5～1/3の金額でのご提供を実現しております。 \r\n \r\n月々50,000円程度のご負担をされていた方で、月々の金額が-22,000円、年間で26.7万円の費用削減につながったという例もございます。 \r\n \r\nこの機会に複合機の経費を見直してみませんか？ \r\nお気軽にお問い合わせください。 \r\n \r\n詳しくはこちら　https://keiyo-chiken.net/ \r\n \r\nご返信やお問い合わせは　info@keiyo-chiken.co.jp　こちらのアドレスにお願いいたします', 1, '2022-11-22 07:28:08', '2023-10-15 17:10:54'),
