(26, 'win sato', 'marcinakcuniffhap@yahoo.co.jp', 'お世話になります。 \r\n私、winサービスの佐藤と申します。 \r\n \r\n突然ではありますが、現在どのような集客媒体をご利用でしょうか？ \r\n様々なものがありますが、弊社が最も力を入れているのが「Google Map」 \r\nGoogle Map利用者は年々増加し、現在利用率83.1％、さらに「Google Map」を参考に来店したユーザーは74.8％ となっており、集客にはなくてはならない立ち位置にあります。 \r\n弊社は、Google Mapの「話題性増加」を含めたMEO施策を行っております。 \r\n具体的に企業や店舗様の集客効果が最大220%まで上がる施策です。 \r\n今後も可能性があるGoogle上にて施策をすることで、将来的にも \r\n媒体に頼らない確固たる集客力を築きませんか？ \r\n \r\n今なら無料相談を実施しておりますので、こちらのサイトからお気軽に \r\nお問い合わせいただければと思います。 \r\n \r\nhttps://nsm-planning.online/ \r\n \r\nよろしくお願い致します。', 1, '2022-12-08 22:36:13', '2023-10-25 07:28:51'),
(27, 'Director sato', 'kandlmamandurk8kak@yahoo.co.jp', 'ご担当者 様 \r\n \r\nお世話になっております。 \r\nNexus project ディレクターの佐藤 大輔と申します。 \r\n \r\n以前にご案内・お話をされたかも知れませんが「フォーム配信」について \r\n大きく仕様変更致しましたので再度ご連絡を致しました。 \r\n \r\n現在では何社か類似したサービスを開始致していることを確認しており \r\n実際に調査・契約→実行をしてサービスを徹底的に調べてみました。 \r\n批判や優勢度を表すのではなく、良い部分は改善や応用をできる部分は行い \r\n向上を目指すという考え方で新たに開発致しました。 \r\n \r\n詳細 \r\nhttps://decemberdm.tokyo/ \r\n \r\n \r\n・ターゲットに合わせてAIが配信先を決定 \r\n \r\nこちらが今回の1番の改善(改良)です。 \r\n通常はランダムにWEBサイトのフォームに配信を致しますが、今回の場合は \r\nお客様がターゲットを絞られている場合において高確率で登録のリストから \r\n適合するWEBサイトにメッセージを送るという非常に画期的なAIを搭載致しました。 \r\n \r\n \r\n・お問い合わせ(アポ）率が向上 \r\n \r\n実際に利用された方はお分かりだと思いますが30%ほど反応率が上がりましたので \r\n配信に抵抗がある方でも実際の結果を見れば費用対効果はございます。 \r\n(既に11月に突入しておりますが11月,12月は1年の中で1番反応率が良い月です) \r\n \r\n・費用がやすい \r\n \r\n1件につき0.075円(100万件配信の場合) \r\n価格については圧倒的に安いので他社比較するまでもございません。 \r\n \r\n \r\n \r\nご興味・ご質問がございましたら下記のフォームにお問い合わせ下さい。 \r\n(ご連絡を頂きましたら、折り返し担当者から詳しい説明をいたします) \r\n \r\nお問い合わせフォーム \r\nhttps://decemberdm.tokyo/ \r\n \r\n--------- \r\n〒156-0041 \r\n東京都世田谷区大原1丁目27-8 \r\nNexus project  Director 佐藤 大輔', 0, '2022-12-12 19:54:23', '2022-12-12 19:54:23'),
(28, 'baton connect', 'batonconnect7@gmail.com', '採用ご担当者様 \r\n \r\nお世話になります。 \r\n株式会社バトンコネクト　代表取締役の吉田と申します。 \r\n \r\n唐突ですが採用活動をしているが、応募が少ないというお悩みはございますでしょうか？ \r\n当社は「いま履歴書を作っている人」に対して、アプローチできる方法をご提案させて頂きます。 \r\n \r\nその方法として、オンライン履歴書サービス「ヤギッシュ」（月間利用者数：33万人）内に、貴社の社長インタビューを掲載することによって、面接応募数を増加させる方法です。インタビュー記事は半永久掲載となりまして、費用は1回のお支払いのみで追加料金は頂きません。 \r\n \r\nぜひ一度オンラインにて、詳しいご紹介が出来ればと存じます。 \r\nhttps://forms.gle/8w9PccuTXu14Xdjx7 \r\n \r\n何卒よろしくお願いいたします。 \r\n　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 \r\n　　　　　　　　　　　　　　　　 \r\n※送信専用のアドレスのためお問合せ等は上記フォームからお願い致します', 0, '2022-12-13 11:24:31', '2022-12-13 11:24:31'),
(29, 'Rey Krallman', 'ToniTichacek59707@gmail.com', 'Add your site to 1000 business directories with one click here-> https://bit.ly/submit_site_1', 0, '2022-12-14 01:11:46', '2022-12-14 01:11:46'),
(30, 'insta 365', 'seligsonbirdmanyxf@yahoo.co.jp', 'Instagramの便利な使い方をご存知でしょうか？ \r\n \r\nhttps://insta-xx.com \r\n \r\n \r\n商品のPRやサービス案内はどのようにされてますでしょうか？ \r\nメルマガ配信,リスティング広告等、様々な宣伝・アピール方法があると思いますが \r\n多くの方々は「SNSを利用した方がいい」という回答を得ています。 \r\n \r\n【SNSの利用とは具体的に何なのか】 \r\n写真・動画投稿をすることがメインだと思いますが、他人に対してイイネ!フォローするなどの \r\n行動もされていると思います。 \r\n実際には有効な手段とは言われていますが自動化しない限りは数多くのユーザーに対して \r\nアピールできないのが現状だと思います。 \r\n \r\n今回ご案内するのは下記のターゲットを選択してDM配信できるサービスです。 \r\n \r\n・地域 \r\n・ロケーション(例:渋谷、具体的な飲食店名,観光地…等々) \r\n・アカウント(例:有名人等のフォロワー等) \r\n \r\nInstagramには3300万人(アクティブユーザー)がおります。 \r\nスパムのように適当にDMを送ったとしても何も効果はありません！ \r\nお客様が求めるターゲットを選んで配信できるサービスです。 \r\n \r\n1日で1万件強のメッセージ配信が可能で、例えばイベントの告知、インフルエンサー募集 \r\nお店のPR等の期間限定や商品の販売、人員募集などにも利用ができます。 \r\nInstagramのアカウントをお持ちでなくても代行でアカウント利用は \r\n無料で可能ですのでご心配ありません。 \r\n \r\nご興味がありましたら下記のページからご連絡を下さいませ。 \r\n \r\nhttps://insta-xx.com', 0, '2022-12-14 03:10:57', '2022-12-14 03:10:57'),
