(32, 'Tokyo Service101', 'okwagelisseykc@yahoo.co.jp', '業界No1「1通0.085円」のお問い合わせフォーム配信！低コストで新規獲得しませんか？ \r\n \r\n突然のご連絡失礼いたします。 \r\n新規の獲得手法にお悩みでは無いでしょうか？ \r\n \r\n弊社は「営業代行」専門会社でございまして \r\n中でも、業界No1「1通0.085円」のお問い合わせフォーム配信が大変好評でございます。 \r\n \r\nhttps://newmailsa.com \r\n \r\nしかも、1日で100万社に配信することができる営業代行会社は他ございません。 \r\n \r\n営業とは確率で、新規獲得数を増やすには「配信する母数」を増やさないことには「契約件数」も上がりません。 \r\n \r\n弊社のサービスは、低コストで圧倒数の配信ができるサービスとなっております。 \r\n \r\nご興味持っていただけましたらぜひ一度「無料相談」にお申し込みください。しつこい営業はいたしません。 \r\n \r\nサービスの詳しい情報はこちら \r\n \r\nご検討どうぞよろしくお願い致します。 \r\n \r\nテレアポに変わる集客サービス \r\nhttps://newmailsa.com', 0, '2022-12-20 00:48:50', '2022-12-20 00:48:50'),
(33, 'Boom Taget', 'senderlingbonasiawwx@yahoo.co.jp', '突然のメッセージを致したことを先にお詫び致します。 \r\n私共はお客様が求める【営業リスト及び配信】を代行しております。 \r\n \r\nhttps://gooo-dm.jp/ \r\n \r\n \r\n通常の名簿屋と言われる業者とは違い、私共はリストを持っていません。 \r\nいつ取得したのか？わからないリストを持っていても意味がないからです。 \r\nお客様からリスト送信のご依頼があった時点でWEB上から最新のリストを取得します。 \r\n最大3500万件ほどのリストが取得可能です。 \r\n \r\n【地域を絞れる】 \r\n都道府県単位ではなく「市町村」更にはそれ以下の地域も絞って営業が可能 \r\n例えば「東京都渋谷区の歯科」だけを選択してリスト化・配信もOK。 INSERT INTO `contacts` (`id`, `name`, `email`, `comment`, `seen`, `created_at`, `updated_at`) VALUES
