(101, 'YouTube Lab', 'ozellacucrs@rediffmail.com', 'ご担当者さま \r\n \r\nはじめまして。 \r\nYouTubeの運用及び管理をやっております柏木（かしわぎ）と申します。 \r\n \r\n社会的価値の高い優れた専門性をお持ちのビジネスオーナーさま向けに、 \r\n「YouTube SEO」と「収益化」などを含めた【YouTubeチャンネル運用支援サービス】を \r\n提供しております。 \r\n \r\n弊社サービスが、貴社ビジネスの認知拡大、新規販路開拓、集客、リピーター獲得に \r\nご活用いただけるのではないかと考え、ご連絡させていただきました。 \r\n \r\nまずは下記の貴社様向けの概要をご覧下さいませ \r\nhttps://youtubemaster.hp.peraichi.com/ \r\n \r\n \r\nYouTubeの収益化に興味はないでしょうか？短期(最短1ヶ月)で可能 \r\nお客様のアカウント収益化が可能となりますので、お急ぎで収益化をご希望の方は \r\nご連絡を下さい。 \r\n \r\n \r\nYouTubeラボ 柏木 \r\n送信専用のアドレスですので、お問い合わせはWEBフォームからご連絡を下さい。', 1, '2023-04-10 21:03:42', '2023-09-20 10:20:51'),
(102, 'mind system', 'info.mindsystem.form@gmail.com', 'お世話になっております。 \r\n \r\n株式会社マインドシステムの大川と申します。 \r\n社長様の社会保険料の件でご連絡を致しました。 \r\n \r\n「未だに社会保険料を満額＝『倍近く』支払ってませんか？」 \r\n \r\n弊社、社会保険料を「約半額」に削減するお手伝いしておりまして、下記概要です。 \r\n \r\n・弊社クライアント様の平均削減額は、「年間約90万円」 \r\n・「顧問の社労士さん、税理士さん」を抱えながら、それでも削減できた方が8割。 \r\n・一度対策を行えば定年退職まで毎年削減メリットが生じる。 \r\n・社長様以外に役員様がいれば、その分削減メリットが増える。 \r\n・全て正しいスキーム（税務署、年金事務所、金融機関に確認済み）。 \r\n \r\n・導入に当たり、煩わしい書類作成などをフルサポート。本業に専念できます。 \r\n・成功報酬型なので、メリット無しに費用発生はありません。キャンペーン中で、費用面はお値引きも。 \r\n・年収を変えずに、社会保険料を約半額に削減が可能（現在の月収次第で、割合は変動） \r\n・会社の経費が減って、個人の手取りが増える \r\n・本方法論で生じる「全てのデメリット」に対して、「対策案」も同時にご提案 \r\n・ご紹介多数の、高満足度。さらにこの度、ご紹介キャンペーンを新たに新設。ご紹介者がご成約の度に最低５万円をお渡しします（諸条件有り） \r\n \r\n詳細な資料をご希望の方はこちらからご請求下さいませ。 \r\nhttps://forms.gle/auyFeZ1bt7rYCaYg6 \r\n \r\nこちらのメールアドレスは送信専用ですので、本件に関するお問い合わせはこちらからお願い致します。 \r\nhttps://forms.gle/QDLkbhQrCvrwxVt98 \r\n \r\n株式会社マインドシステム \r\n代表　大川 岳志　 \r\n \r\n※こちら送信専用アドレスですので恐れ入りますがお問い合わせなどは上記サイトよりよろしくお願い致します。', 1, '2023-04-11 05:20:30', '2023-09-20 10:18:50'),
(103, 'MARKELINE', 'miko20211012@gmail.com', '飲食店経営者の皆様、今話題のリスキリング助成金、自分には関係ないと思っていませんか？実はこの助成金を有効活用して、飲食店の集客に一番効果の高いSNSである「LINEマーケティング」を導入することができます。 \r\nしかも他の助成金も併せて活用することで正規価格の1/5で構築・運用まですべてを丸っと任せることもできてしまうんです。 \r\n \r\n今回の無料セミナーの内容で、チラシや広告などを一切使わずに月に数時間の労力で年間売上を150万以上アップさせたような方もいらっしゃいます。 \r\nなぜSNSが飲食店集客に対して効果的なのか？実際の具体的な事例をあわせてご紹介し、ご質問などにも丁寧にお答えさせていただきます。 \r\n \r\n併せて、助成金について、話題であるけれども実際に自社が使えるのか？使えるとしたらどうすればいいのかというところにも、しっかりと情報提供させていただきます。 \r\n \r\nこの秘密を知ることができるセミナーのご日程は下記のURLから都合のいい日程をお選びください。 \r\nhttps://ex-pa.jp/item/47870/s238644 \r\n \r\nたった30秒の申し込みで、数百万以上の得をつくるチャンスです！ \r\nこの機会を是非お見逃しなく！　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 \r\n　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 \r\n　　　　　　　　　　　　　　　 \r\n※こちら送信専用アドレスですので恐れ入りますがお問い合わせなどは上記サイトよりよろしくお願い致します。', 1, '2023-04-11 06:52:54', '2023-09-20 10:18:33'),
