(7, 'Angry Bird Jump', 'Looking for a fun and challenging way to pass the time? Look no further than 8 Ball Pool Multiplayer! Compete against other players in the game, or you can play with the AI. With intuitive controls and realistic physics, the 8 Ball Pool Multiplayer is easy to pick up and play but difficult to master. 8 Ball Pool Multiplayer is a lot of fun and entertainment for hours, no matter how good or bad you are at pool.So why wait? Play 8 Ball Pool Multiplayer today and start playing the best pool game online!', '1700917522-icon-256.png', '1700917546-icon-256.png', 'angry-bird-jump', 'AllGames/angry-bird-jump', 0, 1, '8 Ball Pool: Play the Classic Pool Game Online', '8 Ball Pool is the classic pool game that you can now play online. Become a pool shark by sinking all of your balls into the pockets before your opponent does.', '8 ball pool, pool game, online pool game, pool shark, realistic physics, stunning graphics, multiplayer,challenging, immersive,Fun', '2022-05-19 16:43:25', '2023-11-25 11:05:46'),
(42, 'Eatable Fishes', 'Ludo Game Multiplayer is the best way to play games online if you want to relive your childhood. Ludo is easy to play and perfect for all ages. Roll the dice and move your tokens to reach the finish line before your opponents. The game is played on a colorful board with four different colors of tokens. When playing Ludo, there can be 2, 3, or 4 people. Each person rolls the dice once. The rules of Ludo Game Multiplayer are simple: roll the dice and move your pieces around the board, trying to be the first to get all your pieces home. Although Ludo appears easy to play, winning this game requires skill and a little bit of luck. With Ludo Game Multiplayer, you can play against random opponents or invite your friends to join in the fun. So what are you waiting for? Play Ludo Game Multiplayer today and start playing with friends and family around the world.', '1700917674-icon-256.png', '1700917674-icon-256.png', 'eatable-fishes', 'AllGames/eatable-fishes', 0, 0, 'Ludo: The Classic Board Game Online', 'Ludo is a classic board game that can be enjoyed by people of all ages. Play Ludo online with your friends and family and have a blast!', 'ludo, ludo game, online ludo, board game, classic board game, indian board game, multiplayer game, online multiplayer game, friends and family, fun and addictive, simple rules, easy-to-learn gameplay', '2023-03-03 19:13:35', '2023-11-25 11:07:54'),
(49, 'Escaping Zombie', 'Join the adventure with the Flying Cat and help it collect as many fish as possible while soaring through the skies. With the simple and one tap  controls, this endless game is easy to play but hard to master.becameAvoid obstacles and enemies while collecting power-ups and coins to unlock new cats and backgrounds. Challenge your friends to see who can beat your highest score.Experience hours of fun and entertainment with this cute and addictive game. Play Flying Cat now and start your endless adventure in the skies!', '1700917756-icon-256.png', '1700917756-icon-256.png', 'escaping-zombie', 'AllGames/escaping-zombie', 0, 0, 'Have Fun and Challenge Yourself in Flying Cat', 'Flying Cat is a fun and challenging game where you help a cat fly through the air. Use your mouse to control the cat and avoid obstacles.', 'flying cat game, cat game, flying game, challenging game, fun game, mouse control, obstacle avoidance, score, record, all ages', '2023-03-08 02:06:07', '2023-11-25 11:09:16'),
(51, 'Fairy Falls', 'Welcome to the Halloween Candy Match arcade game! The objective of this fun game is to match the Candy Bat with other Candy Bat and the Pumpkin Candy with other Pumpkin Candy. You can do this by tapping right and left just on the game board using your keyboard or mouse until you find the ideal match. To start the game, simply click on the \"play\" button and begin sorting the angels and devils.Good luck and have fun playing the Halloween Candy Match arcade game!', '1700917854-icon-256.png', '1700917854-icon-256.png', 'fairy-falls', 'AllGames/fairy-falls', 0, 0, 'Get into the Halloween Spirit with Our Candy Matching Game', 'Our Halloween Candy Matching Game is the perfect way to get into the Halloween spirit. Match up the candies and see how high you can score.', 'Halloween candy matching game, Halloween game, candy matching game, matching game, Halloween, candy, prizes, free game, spooky, fun', '2023-03-10 16:22:50', '2023-11-25 11:10:54'),
(52, 'Fairyland', 'Daruma Matching is a puzzle game where your goal is to match 3 or more Daruma dolls to earn the highest score possible. To play the game, simply swap two adjacent Daruma dolls to create a horizontal or vertical line of three or more of the same color. When you make a match, the Daruma dolls will disappear from the game board, and you\'ll earn points. The more dolls you match at once, the higher your score will be. You can also earn bonus points by making special combinations, such as matching four or five dolls in a row.', '1700917920-icon-256.png', '1700917920-icon-256.png', 'fairyland', 'AllGames/fairyland', 0, 0, 'Match Daruma to Win in This Fun and Addictive Game', 'Daruma Matching is a challenging puzzle game. Match three or more Daruma to clear the board and progress to the next level.', 'Daruma 3 Matching, Daruma Matching, puzzle game, challenging puzzle game, mind-bending puzzle game, fun puzzle game, addictive puzzle game, match 3 puzzle game, Daruma, Japanese culture, traditional Japanese toys', '2023-03-10 17:17:34', '2023-11-25 11:12:00'),
(53, 'Floppy Skibidi', 'Survival Starfish is a fun and engaging game where players must help a starfish navigate dangerous waters filled with enemies. Your mission is to keep the starfish safe by avoiding or defeating these enemies while racking up points to achieve the highest score possible. simply use your device\'s touch screen to guide the starfish around obstacles and evade the enemy creatures that lurk in the waters. Also, you can collect power-ups and bonuses like speed boosts and shields to help you. the challenges become more difficult, and the enemies become more numerous and dangerous. But with quick reflexes and strategic thinking, you can help your starfish survive and thrive. If you need some quick entertainment during a break, Survival Starfish is a great choice.', '1700918061-icon-256.png', '1700918061-icon-256.png', 'floppy-skibidi', 'AllGames/floppy-skibidi', 0, 0, 'Survival Starfish: Battle for Survival in the Ocean', 'Survival Starfish is a challenging and addictive game where you must battle for survival in the ocean. Control your starfish from sea creatures.', 'survival starfish, starfish game, ocean game, survival game, challenging game, addictive game, simple controls, addictive gameplay, all ages, hours of entertainment', '2023-03-10 17:49:32', '2023-11-25 11:14:21'),
(54, 'Flying Challenge', 'Pong Fish is a casual online game that involves a fish swimming within a boundary. Your objective is to prevent the fish from venturing outside the boundary while also collecting points. The fish moves left, right, and up and down, much like in the classic game of Pong. You control the fish\'s movements by tapping the screen to change its direction. As you progress through the levels, the game becomes more challenging with faster-moving fish . Pong Fish is a great way to pass the time while also testing your reflexes and strategy skills.', '1700918132-icon-256.png', '1700918132-icon-256.png', 'flying-challenge', 'AllGames/flying-challenge', 0, 1, 'Pong Fish: Play and Become a Master of the Game', 'Pong Fish is the ultimate fish batting game. With simple controls and addictive gameplay, you\'ll be hooked in no time.', 'pong fish, fish game, batting game, simple controls, addictive gameplay, beginner friendly, challenging, fun, free to play', '2023-03-10 18:40:20', '2023-11-25 11:15:32'),
(55, 'Football Pong', 'Circle Fish is an exciting arcade game that will keep you entertained for hours on end. In this addictive game, you play as a small fish that must swim through circles to earn points. You\'ll have to avoid a lot of different things along the way if you want to stay alive.  You can get new characters and power-ups to help you by collecting coins. Circle Fish is a fun activity for players of every age because it is easy to learn and also has difficult levels.Circle Fish is a very easy to play fun game. It looks nice and has a catchy soundtrack. Then why not just do it? Try to swim as far as you can in Circle Fish.', '1700918198-icon-256.png', '1700918198-icon-256.png', 'football-pong', 'AllGames/football-pong', 0, 0, 'Play Circle Fish and See How Far You Can Get', 'Circle Fish is an addictive online game where you control a fish to move forward. The game is simple but challenging, and it\'s perfect for players of all ages.', 'circle fish, online game, addictive game, eating game, fish game, challenge, simple game, challenging game, fun game, free game', '2023-03-10 19:28:50', '2023-11-25 11:16:38'),
(56, 'Hungry Squirrel', 'Sudoku Blocks is a classic puzzle game that tests your ability to think logically and solve problems. It has very easy rules to understand and addictive gameplay. There are a lot of helpful features in Sudoku Blocks, like auto-check and auto-fill, that will help you finish puzzles faster. You can also change the game\'s look by using different themes and backgrounds. Play this puzzle game right away and start using your brain right away.', '1700918249-icon-256.png', '1700918249-icon-256.png', 'hungry-squirrel', 'AllGames/hungry-squirrel', 0, 0, 'Sudoku Blocks: A challenging and addictive puzzle game', 'Sudoku Blocks is a challenging and addictive puzzle game that will test your skills. With simple rules and a clean interface, it\'s easy to pick up and play.', 'sudoku blocks, puzzle game, challenging, addictive, swipe and match, fill the grid, solve the puzzle, high score, relax, challenge your mind', '2023-03-10 19:41:49', '2023-11-25 11:17:29'),
(57, 'Marine Fish', 'In Cargo Truck Survival, you take on the role of a daring truck driver navigating treacherous roads and delivering vital cargo to various destinations. To avoid mishaps, you\'ll need to be attentive and focused at all times, on steep mountain vehicles like trucks, buses, and cars, as well as humans too. All you have to do is stay attentive to the road to overcome the accidents. With its stunning graphics, realistic physics engine, and challenging gameplay, Cargo Truck Survival is sure to keep you entertained and engaged for hours on end. So why wait? Download it now and start your journey to become the ultimate trucking hero!', '1700918413-icon-256.png', '1700918413-icon-256.png', 'marine-fish', 'AllGames/marine-fish', 0, 0, 'Cargo Truck Survival: Play and survive.', 'Cargo Truck Survival is a challenging game where you must avoid crashing.  Use your skills to survive', 'cargo truck survival, driving games, challenging games, obstacle course games, survival games, driving skills, cargo delivery, dangerous roads, forests, deserts', '2023-03-10 20:07:38', '2023-11-25 11:20:13'),
(58, 'Mermaid Adventure', 'Brazil and Argentina are two of the biggest soccer powerhouses in the world, and now you can experience their rivalry on the field in this exciting mobile game. Choose your team now and start playing Brazil vs. Argentina. Test your skills and help your team win the trophy. Brazil vs. Argentina is a simple and fun game to play anytime, anywhere. Everyone can participate in the games because of their simple rules.   So, what are you waiting for? Play now and show the world who the real champion is!', '1700918469-icon-256.png', '1700918469-icon-256.png', 'mermaid-adventure', 'AllGames/mermaid-adventure', 0, 0, 'Brazil vs. Argentina Play the Best Online Football Game', 'This football game is the perfect way to experience the excitement of the sport. Play and see how many goals can do.', 'football game, online football game, football, soccer, game, sport, realistic graphics, gameplay, customization, victory, levels', '2023-03-10 20:51:08', '2023-11-25 11:21:09'),
(60, 'Neon Jump', 'Tomato Ketchup is an exciting adventure game where you get to save the tomatoes from the clutches of an evil chef. Protect the tomato from harm. This game\'s beautiful visuals and straightforward but compelling gameplay will keep you occupied for hours. The more you play the more you get addictive of the game. Tomato Ketchup\'s easy-to-understand controls and simplistic gameplay make it suitable for players of all ages.So what are you waiting for? Join the fun and save the tomatoes in Tomato Ketchup today!', '1700918608-icon-256.png', '1700918608-icon-256.png', 'neon-jump', 'AllGames/neon-jump', 0, 0, 'Tomato Ketchup: Create your own fun.', 'The Tomato Ketchup game is perfect for all ages. It\'s a great way to have some fun. So what are you waiting for? Play Tomato Ketchup today!', 'tomato ketchup game, ketchup game, educational game, fun game, history of ketchup, making ketchup, ingredients for ketchup, different types of ketchup, kids game, adult game', '2023-03-10 21:41:28', '2023-11-25 11:23:28'),
(61, 'Royal Kingdom', 'The world has been overtaken by zombies, and you must fight for your life on an endless highway in Horror Highway: Zombie Survival. You\'ll have to use your wits and agility to make it past swarms of zombies without getting eaten. To continue playing, you need to stay awake and keep your eyes on the road to avoid obstacles. Amazing visuals and a tense score make Horror Highway: Zombie Survival the pinnacle of survival games. Will the zombies stop you before you reach safety at the end of the road?Start playing Horror Highway now!', '1700918678-icon-256.png', '1700918678-icon-256.png', 'royal-kingdom', 'AllGames/royal-kingdom', 0, 1, 'Horror Highway: Drive Fast and Avoid Obstacles', 'Horror Highway is the perfect way to test your driving skills. With fast-paced gameplay and challenging obstacles, you\'ll need to be quick and agile.', 'highway car game, car game, driving game, racing game, fast-paced game, challenging game, obstacles, customization, car enthusiasts, free games', '2023-03-10 22:03:12', '2023-11-25 11:24:38'),
(62, 'Run Fish Run', 'Color Pumpkin Match is a fun and addictive puzzle game where you match pumpkins to blast through levels. Because there is no end to gaming, the game is entertaining for players of all ages. The gameplay is simple but challenging - match three or more pumpkins of the same color to create a blast and earn points. Color Pumpkin Match features colorful graphics and lively music, making it a visual and auditory delight. The game offers hours of fun and is ideal for both puzzle lovers and casual gamers.', '1700918840-icon-256.png', '1700918840-icon-256.png', 'run-fish-run', 'AllGames/run-fish-run', 0, 0, 'Color Pumpkin Matching: A Fun and Challenging Game for all', 'Match the pumpkins of the same color to score points. The more pumpkins you match, the higher your score will be.', 'pumpkin color matching game, pumpkin matching game, color matching game, matching game, puzzle game, skill game, kids game, adult game, free game', '2023-03-10 23:42:24', '2023-11-25 11:27:20'),
(64, 'Save The Egg', 'Crab Shooter is the latest hit arcade game from Xoss Games. Are you ready to take on the challenge? In this exciting game, you\'ll take on the role of a fearless crab hunter, shooting and collecting treasures as you go. With stunning graphics, intuitive gameplay, and endless levels of fun, Crab Shooter is sure to keep you entertained for hours on end. You\'ll never run out of ways to keep the action interesting and thrilling thanks to the variety of power-ups and special objects ready to unlock. So what are you waiting for? Play Crab Shooter today and start shooting those crabs!', '1700918897-icon-256.png', '1700918897-icon-256.png', 'save-the-egg', 'AllGames/save-the-egg', 0, 0, 'Play the Best Crab Shooter Game and Blast Those Crabs Away', 'Crab Shooter is a fun and addictive crab shooting game. Blast those crabs away with your powerful cannon to save the fish!', 'crab shooter, crab shooting game, fun games, addictive games, simple controls, addictive gameplay, casual games, hardcore games, cannon, crabs', '2023-03-12 12:05:55', '2023-11-25 11:28:17'),
(65, 'Skibidi Vs Alien', 'Join the Daruma Tiger on an exciting adventure through the mountains and forests. Avoid challenging obstacles and collect coins to unlock new characters and power-ups. With simple one-touch controls, anyone can pick up and play this endless adventure game.  With intuitive one-touch controls and smooth gameplay, you\'ll find yourself lost in the stunning visuals and immersive sound effects. Play solo or challenge your friends in this addictively fun game. Play Daruma Tiger Run now and embark on an endless adventure!', '1700918967-icon-256.png', '1700918967-icon-256.png', 'skibidi-vs-alien', 'AllGames/skibidi-vs-alien', 0, 0, 'Play the Fun and Exciting Durama Tiger Run Game', 'Durama Tiger Run is a fun and exciting game where you play as a tiger running through the jungle. Dash through obstacles, avoid traps and catch your prey.', 'durama tiger run, tiger run game, jungle run game, running game, dash game, obstacle game, trap game, prey game, addictive gameplay, simple controls, fun and exciting', '2023-03-12 13:45:46', '2023-11-25 11:29:27'),
(66, 'Summer Dino', 'In Fall of Swords, you\'ll find yourself in a fantasy world where your journey begins as a novice adventurer. You\'ll face challenges, make choices, and progress through the game by exploring and completing quests. You\'ll encounter fierce battles and engage in strategic combat to defeat your foes. With each victory, you\'ll grow stronger and develop new skills, unlocking greater challenges and secrets along the way. Customize your character, choose your own path, and become the hero in this immersive RPG adventure.The environment is waiting for you to discover its secrets, the action is fast. Play Fall of Swords today and begin your epic journey!', '1700919103-icon-256.png', '1700919103-icon-256.png', 'summer-dino', 'AllGames/summer-dino', 0, 0, 'Fall of Swords: Immerse Yourself in the Thrill', 'Fall of Swords is an epic online game where you have to stay aware and save yourself from the swords. Play now!', 'fall of swords, online action game, epic game, battle, victory, characters, weapons, levels, stunning graphics, immersive gameplay, test your skills, thrill of combat', '2023-03-12 13:56:37', '2023-11-25 11:31:43'),
(68, 'Vampire\'s Survival', 'Experience the thrill of underwater combat in Submarine Shooter - Deep Sea Adventure! As a brave submarine commander, your mission is to protect your country\'s naval fleet by taking down enemy submarines lurking in the deep sea. To battle in deadly combat with enemy submarines, load your submarine with powerful weapons, including bombs and explosives, and navigate through dangerous waters.With stunning graphics and realistic sound effects, Submarine Shooter - Deep Sea Adventure offers an immersive gaming experience that will keep you hooked for hours. Unlock new submarines and upgrade your weapons as you progress through the game and face increasingly challenging enemies. Can you become the ultimate submarine commander and save your country from enemy threats?', '1700919184-icon-256.png', '1700919184-icon-256.png', 'vampire\'s-survival', 'AllGames/vampires-survival', 0, 0, 'Submarine Shooter:Battle Enemy Submarines and Save the Ocean', 'Submarine Shooter is an action submarine game where you must battle enemy submarines to save the ocean. This is the perfect game for fans of submarine warfare.', 'submarine shooter, submarine game, action game, ocean game, free game, shooting game, warfare game, combat game, strategy game, adventure game', '2023-03-12 15:14:22', '2023-11-25 11:33:04'),
